import './App.css';
import{
  BrowserRouter,
  Routes,
  Route
}from 'react-router-dom';

import HomePage from './component/HomePage';
import Navigation from './component/Navigation';
import Instagarm from './component/Instagram';


function App() {
  return (

    <BrowserRouter>
    <Routes>
      <Route path='/' element={<HomePage/>}></Route>

      <Route path='/nav' element={<Navigation/>}></Route>

    <Route path='/photo' element={<Instagarm/>}></Route>

    <InstaFeeds token={process.env.REACT_APP_INS_TOKEN} limit={12}/>


    </Routes>
    </BrowserRouter>

  );
}

export default App;
